import{_ as e,c as r,o as t,ah as l,uf as n}from"./chunks/framework.D5cOWG0Y.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"daily/软考中级软件设计师学习笔记/08_算法设计与分析.md","filePath":"daily/软考中级软件设计师学习笔记/08_算法设计与分析.md","lastUpdated":1756054686000}'),i={name:"daily/软考中级软件设计师学习笔记/08_算法设计与分析.md"};function o(c,a,d,h,p,s){return t(),r("div",null,[...a[0]||(a[0]=[l('<h2 id="算法基础" tabindex="-1">算法基础 <a class="header-anchor" href="#算法基础" aria-label="Permalink to “算法基础”">​</a></h2><h3 id="算法基础知识" tabindex="-1">算法基础知识 <a class="header-anchor" href="#算法基础知识" aria-label="Permalink to “算法基础知识”">​</a></h3><p>算法的五个重要特性：</p><ul><li>有穷性</li><li>确定性</li><li>可行性</li><li>输入：0或多个</li><li>输出：一个或多个</li></ul><h3 id="算法分析基础" tabindex="-1">算法分析基础 <a class="header-anchor" href="#算法分析基础" aria-label="Permalink to “算法分析基础”">​</a></h3><p>算法复杂性包括两个方面，一个是算法效率的度量（时间复杂度），一个是算法运行所需要的计算机资源量的度量（空间复杂度），这也是评价算法优劣的重要依据。</p><h4 id="时间复杂度" tabindex="-1">时间复杂度 <a class="header-anchor" href="#时间复杂度" aria-label="Permalink to “时间复杂度”">​</a></h4><p>一个程序的时间复杂度是指程序运行从开始到结束所需要的时间。通常分析时间复杂度的方法是从算法中选取一种对于所研究的问题来说是基本运算的操作，以该操作重复执行的次数作为算法的时间度量。一般来说，算法中原操作重复执行的次数是规模n的某个函数T（n）。由于许多情况下要精确计算T（n）是困难的，因此引入了渐进时间复杂度在数量上估计一个算法的执行时间。</p><p>我们通常使用&quot;O（）&quot;来表示时间复杂度，其定义如下：如果存在两个正常数c和m，对于所有的n，当n≥m时有f（n）≤cg（n），则有f（n）=O（g（n））也就是说，随着n的增大，f（n）渐进地不大于g（n）。例如，一个程序的实际执行时间为3n^3+2n^2+n,则T（n）=O（n^3）。T（n）和n^3的值随n的增长渐近地靠拢。常见的渐进时间复杂度有：</p><p><img src="'+n+'" alt="image-20240414222317823" loading="lazy"></p><h4 id="空间复杂度" tabindex="-1">空间复杂度 <a class="header-anchor" href="#空间复杂度" aria-label="Permalink to “空间复杂度”">​</a></h4><p>一个程序的空间复杂度是指程序运行从开始到结束所需的存储量。它通常包括固定部分和可变部分两个部分。</p><p>在算法的分析与设计中，经常会发现时间复杂度和空间复杂度之间有着微妙的关系，经常可以相互转换，也就是可以利用空间来换时间，也可以用时间来换空间。</p><h2 id="常用算法" tabindex="-1">常用算法 <a class="header-anchor" href="#常用算法" aria-label="Permalink to “常用算法”">​</a></h2><h2 id="参考资料" tabindex="-1">参考资料 <a class="header-anchor" href="#参考资料" aria-label="Permalink to “参考资料”">​</a></h2><p>视频</p><p>希赛网</p><p>文字版</p><p><a href="https://cloud.tencent.com/developer/article/2385825" target="_blank" rel="noreferrer">https://cloud.tencent.com/developer/article/2385825</a></p><p><a href="https://cloud.tencent.com/developer/article/2387285" target="_blank" rel="noreferrer">https://cloud.tencent.com/developer/article/2387285</a></p><p><a href="https://blog.csdn.net/chengsw1993/article/details/125714839" target="_blank" rel="noreferrer">https://blog.csdn.net/chengsw1993/article/details/125714839</a></p>',21)])])}const m=e(i,[["render",o]]);export{f as __pageData,m as default};
